import {cardData} from "./data/cat_data";
import Card from "./Components/Card";
import "./Cats.css"

function Cats(){
    const catCards = cardData.map(item =>{
        return (
            <div className="cat_cards">
                <Card title={item.title} imgSrc={item.imgSrc} imgAlt={item.imgAlt} text={item.text} key={item.title} />
            </div>
        );
    });
    return (
        <div className="cat_main__content">
            {catCards}
        </div>
    )
}
export default Cats;
